import React, { Component } from 'react'
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import {Link,Redirect} from 'react-router-dom';
import './Navbar.css' 
import { connect } from 'react-redux'
import {logout} from '../actions/actions.auth'

function Navs2({}) {
  // render(){
  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand>Career</Navbar.Brand>
        <Nav className="mr-auto">
          <Link className="link1" to="/">
            Home
          </Link>
          <Link className="link2" to="/list">
            List
          </Link>
          <Link className="link3" to="/about">
            About
          </Link>
          <Link className="link4" to="/signup">
            Signup
          </Link>
          <Link className="link5" to="/login">
            Login
          </Link>
        </Nav>
      </Navbar>
    </div>
  );
  // }
}

export default Navs2;
